import React from "react";

const Show = (props: any) => {
  return (
    <div>
      
      <img src={props.image} alt='cryptocurrency'/><h3>{props.name}</h3> <p>{props.symbol.toUpperCase()}</p> <p>${props.price}</p> <p>{props.priceChange}%</p>
    </div>
  );
};

export default Show;
